                                <div className="front-right-content">
                                    <h2>Hello, Friend!</h2>
                                    <p>Fill up personal information and
                                        start journey with us.</p>
                                    <input htmlFor="button" value="Sign Up" />
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default UserAuthentication;
